★シダスのインソール！<br>
<br>
●吸湿性があり足当たりのよいマイクロファイバー素材を表面に採用。<br>
●裏面素材をポリエチレンに変更し前足部の足当たりがソフトに。<br>
●カカトと土踏まずをソフトにサポートし快適なシティウォーキングをもたらします！<br>
●通勤や仕事中にかかる足の負担を軽減！ビジネスシューズのお供にオススメです！<br>
●つま先の厚さ：1.8mm<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
