★快適なシティウォーキングを提供！シダスの高機能インソール！<br>
<br>
●アスファルトの衝撃を分散し快適なシティウォーキングをサポートする女性のためのインソール！<br>
●パンプス等細身のレディスシューズに最適！<br>
●吸湿性に優れ、足当たりのよいAMF素材を表面に採用！<br>
●より多くのシューズに対応できる前足部のカット形状！<br>
●しっかりしなやかに踵とアーチを支える！<br>
●つま先の厚さ:1.8mm<br>
<br>
