★アシマルの外反母趾対策ソール！<br>
<br>
●女性の足の悩み、外反母趾対策に効果的！<br>
●表面生地はスエード調のベージュ色でいろいろなシューズにマッチ！<br>
●表面生地下部は銀イオンスポンジ(AgFoam)になっており、抗菌、通気性、やわらかい肌ざわりで快適にフィット！<br>
●本体スポンジは反発性ウレタン素材で衝撃吸収だけでなく、バランス良く足腰を支えます！<br>
●早めの予防で快適な生活を送りたい方へもおすすめ！<br>
<br>
■素材<br>
表面：ポリエステル<br>
銀イオンスポンジ、本体スポンジ、ラバー：ポリウレタン<br>
